import './App.css';
import {MessageList} from "./MessageList";
import React, { useState, useEffect } from "react";
import { useQuery } from "react-query";

const getFiles=()=>{

    let files = fetch("http://localhost:8080/messages").then((response) => response.json())
    return files ? files.json() : undefined;
}


function App() {
    const [files, setFiles] = useState([]);

    useEffect(() => {
        const query = useQuery<Array<File>, Error>("files", getFiles);
        const { data } = query;
        data.subscribe((data) => setFiles(data));
    }, []);

  return (
    <div className="App">
      <MessageList text={"Hello"}/>
    </div>
  );
}

export default App;
